import React from "react";
import { useState } from "react";
import { Link } from "react-router-dom";

function Homepage() {
    const [posts] = useState([
        {
            id: "1",
            title: "How to cook tasty dinner",
            body: "Lorem ipsum dolor sit amet consectetur adipisicing elit. Velit, aliquam.",
        },
    ]);
    return (
        <div className='mainWrapper'>
            <div className='list'>
                <h2>Posts</h2>
                {Array.isArray(posts) &&
                    posts.map(post => {
                        return (
                            <Link
                                key={post.id}
                                className='postItem'
                                to={`/posts/${post.id}`}
                            >
                                <h3>{post.title}</h3>
                                <p>{post.body}</p>
                            </Link>
                        );
                    })}
            </div>
        </div>
    );
}

export default Homepage;
